import React, { useState } from "react";
import { Navbar } from "../index";
import arrow from "./arrow-circle.svg";
import "./Tracking.css";

function ShippingForm() {
  const [searched, setSearched] = useState(false);

  const handleSearch = () => {
    setSearched(true);
  };

  // Sample data for demonstration
  const events = [
    { time: "15:37:00", date: "2024-04-12", detail: "Picked up", branch: "branch name" },
    { time: "23:47:39", date: "2024-04-12", detail: "Arrived", branch: "first distribution center name" },
    { time: "06:48:14", date: "2024-04-13", detail: "Departed", branch: "first distribution center name" },
    { time: "16:51:16", date: "2024-04-13", detail: "Arrived", branch: "second distribution center name" },
    { time: "08:52:30", date: "2024-04-14", detail: "On delivery", branch: "Courier name: tel 09xxxxxxxxx" },
    { time: "10:02:31", date: "2024-04-14", detail: "Delivered", branch: "Thank you for using Pengu Express" }
  ];

  return (
    <div>
      <Navbar />
      <div className="Tracking-container" id="container">
        <form>
          {!searched && (
            <div className="Tracking-Header">
              <h1>Track Parcel</h1>
              <span>Enter tracking number to trace your parcel's number</span>
              <br />
              <br />
            </div>
          )}
          <div className="search-bar">
            <input
              className="form tracking"
              type="text"
              placeholder="Tracking No."
            />
            <button
              type="button"
              className="btn tracking"
              style={{ marginTop: "7px" }}
              onClick={handleSearch}
            >
              Search
            </button>
          </div>
          <div className="Track-group">
            <div className="Track-formgroup">
              <label htmlFor="" className="sender">
                <span>From:</span>
                <h3>Sender name</h3>
                <span>Provinces</span>
              </label>
            </div>

            <div className="Track-formgroup">
              <br />
              <img src={arrow} alt="arrow" className="arrow-img" />
            </div>
            <div className="Track-formgroup">
              <label htmlFor="" className="receiver">
                <span>To:</span>
                <h3>Receiver name</h3>
                <span>Provinces</span>
              </label>
            </div>
          </div>
          <br />
          <p>Latest status</p>
          <br />
          <ul className="events">
            {events.map((event, index) => (
              <li key={index} className={event.branch ? "event-blue" : "event-gray"}>
                <time>
                  {event.time}
                  <br />
                  <date>{event.date}</date>
                </time>
                <span>
                  <strong>{event.detail}</strong> {event.branch}
                </span>
              </li>
            ))}
          </ul>
        </form>
      </div>
    </div>
  );
}

export default ShippingForm;
